function App() {
  const [list, setList] = useState([]);
  const [input, setInput] = useState("");

  return (
    <div>
      <h1>To do List</h1>
      <input
        type="text"
        value={input}
        onChange={(e) => setInput(e.target.value)}
      ></input>
      <button>Add</button>
    </div>
  );
}

export default App;
